import React from "react";


const CreateNote = () => {
    return (
        <>
            <div class="mx-auto mt-3" style={{ width: '200px' }}>
                <form className="text-center">
                    <div class="card shadow-lg shado" style={{ width: "18rem" }}>
                        <input className="" type="text" placeholder="Title" />
                        <div class="card-body">
                            <textarea className="w-100 m-0 h-100" placeholder="Enter text" rows="" column="" />
                        </div>
                    </div>
                </form>
            </div>


        </>
    )
}
export default CreateNote;

